AL REVISAR EL SISTEMA DE INFORMACIÓN, SE ENCONTRÓ QUE USTED ADELANTÓ UN PRE-REGISTRO EN LAS CONVOCATORIAS DE LA VIGENCIA 2024, SIN EMBARGO, DE ACUERDO CON LA ASIGNACIÓN PRESUPUESTAL PARA EL AÑO 2025, NO FUE POSIBLE OTORGAR INSCRIPCIONES AL PROGRAMA. EN CONSECUENCIA, SU ESTADO CAMBIÓ A REGISTRO VENCIDO.
ES IMPORTANTE ACLARAR QUE, EL ESTADO MENCIONADO NO LO HACE UN PARTICIPANTE ACTIVO EN EL PROGRAMA, POR LO TANTO, NO ES SUSCEPTIBLE DE VERIFICACIÓN DE COMPROMISOS NI DE ENTREGA DE TRANSFERENCIAS MONETARIAS CONDICIONADAS.
POR LA ANTERIOR LE INVITAMOS A MANTENER SUS DATOS ACTUALIZADOS EN LA BASE DE POBLACIÓN VULNERABLE A LA QUE PERTENECE, POR SI SE LLEGA A AUTORIZAR UN NUEVO PROCESO DE INSCRIPCIONES, LO QUE SE INFORMARÁ A TRAVÉS DE LOS CANALES DE COMUNICACIÓN OFICIALES DE PROSPERIDAD SOCIAL.&quot;

GAEEL DAVID PALMERA CARRANZA &quot;NO CUMPLIMIENTO DE COMPROMISOS  
VACUNACIÓN&quot;
 RELIQUIDACIONES NO

&quot;INDICACIÓN AL CIUDADANO 
(+ ESTADO ACTUAL EN CM) COMPLEMENTA CON EL GUION  DE ABAJO&quot;

PILAR SOLIDARIO ESTADO ACTIVO EN CM

MINISTERIO DE IGUALDAD Y EQUIDAD


&quot;PROSPERIDAD SOCIAL NO MANEJA ESTA INFORMACIÓN. LA ENTIDAD QUE PUEDE AYUDARLE EN ESTE CASO ES EL MINISTERIO DE IGUALDAD Y EQUIDAD, YA QUE ES LA ENCARGADA DE GESTIONAR ESE TIPO DE SOLICITUDES.
DEBE COMUNICARSE DIRECTAMENTE CON ELLOS PARA OBTENER UNA RESPUESTA PRECISA Y OPORTUNA. CON GUSTO LE BRINDARÉ LOS CANALES DE ATENCIÓN: LÍNEA NACIONAL: 01 8000 121181 (SOLO DESDE TELÉFONO FIJO), EN BOGOTÁ AL NÚMERO 601 6664543 EN EL HORARIO DE LUNES A VIERNES DE 8 AM A 4:30 PM EN JORNADA CONTINUA. O EN LA PÁGINA WWW.MINIGUALDADYEQUIDAD.GOV.CO O ESCRIBIR AL CORREO ELECTRÓNICO CONTACTO@MINIGUALDAD.GOV.CO.&quot;

&quot;
BRINDAR INDICACIÓN AL CIUDADANO DE PILAR SOLIDARIO + INDICACIÓN AL CIUDADANO DE CM. 
NO BRINDAR LINK VIRTUAL NI SUGERIR PROCESO PRESENCIAL 

LE INVITAMOS A QUE SIGA PENDIENTE PARA VERIFICAR NOVEDADES CONFORME SE IMPLEMENTE EL PROGRAMA PILAR SOLIDARIO A TRAVÉS DE NUESTROS CANALES OFICIALES DE ATENCIÓN: TELEFÓNICOS, VIRTUALES, PÁGINA WEB Y REDES SOCIALES.&quot;

&quot;

COMO RESULTADO DEL PROCESO DE SELECCIÓN, SU HOGAR ACTUALMENTE SE ENCUENTRA EN ESTADO REGISTRADO, LO CUAL QUIERE DECIR QUE HA SIDO SELECCIONADO COMO POTENCIAL BENEFICIARIO DEL PROGRAMA DEVOLUCIÓN DEL IVA, Y ESTÁ INCLUIDO EN EL SISTEMA DE INFORMACIÓN. 
EL PROCESO DE SELECCIÓN DE BENEFICIARIOS DEL PROGRAMA DEVOLUCIÓN DEL IVA PARA CADA CICLO OPERATIVO CORRESPONDE A UN ORDENAMIENTO DEL NIVEL DE VULNERABILIDAD Y DE LA DISPONIBILIDAD DE LOS RECURSOS PARA SETECIENTOS MIL HOGARES, SIN EMBARGO, DEBIDO AL ESTADO QUE PRESENTA, NO ES SUSCEPTIBLE DE ENTREGA DE TRANSFERENCIA POR LO QUE LE RECOMIENDO ESTAR PENDIENTE A LOS CANALES DE ATENCIÓN EN FUTUROS CICLOS DE ENTREGA.&quot;

&quot;
ME PERMITO INFORMARLE QUE, SEGÚN EL REPORTE DE CUMPLIMIENTO MENSUAL CERTIFICADO POR EL MINISTERIO DE IGUALDAD Y EQUIDAD, USTED NO ALCANZÓ EL 70% EN LAS ACTIVIDADES DE EDUCACIÓN Y CORRESPONSABILIDAD REQUERIDAS PARA RECIBIR LA TRANSFERENCIA MONETARIA CONDICIONADA.

PARA RECIBIR INFORMACIÓN DETALLADA DE LOS CUMPLIMIENTOS, LE INVITAMOS A COMUNICARSE CON EL MINISTERIO DE IGUALDAD Y EQUIDAD A TRAVÉS DE LA LÍNEA NACIONAL: 01 8000 121181 (SOLO DESDE TELÉFONO FIJO) Y EN BOGOTÁ: (601) 6664543. EL HORARIO DE ATENCIÓN ES DE LUNES A VIERNES, DE 8:00 A.M. A 4:00 P.M. EN JORNADA CONTINUA. TAMBIÉN PUEDE VISITAR LA PÁGINA WWW.MINIGUALDADYEQUIDAD.GOV.CO O ESCRIBIR AL CORREO ELECTRÓNICO CONTACTO@MINIGUALDAD.GOV.CO.&quot;

&quot;RENTA JOVEN ES UN PROGRAMA DE PROSPERIDAD SOCIAL QUE BUSCA LA INCLUSIÓN SOCIAL Y ECONÓMICA DE JÓVENES EN POBREZA Y VULNERABILIDAD. SU OBJETIVO ES FACILITAR EL ACCESO Y LA PERMANENCIA EN LA EDUCACIÓN SUPERIOR DE LOS JÓVENES DEL PAÍS, ADEMÁS DE FORTALECER LAS TRAYECTORIAS DE VIDA MEDIANTE LA ENTREGA DE TRANSFERENCIAS MONETARIAS.

ACTUALMENTE NO HAY CONVOCATORIAS ABIERTAS PARA INSCRIPCIONES DEBIDO A LA ASIGNACIÓN PRESUPUESTAL DE 2025. CUALQUIER NOVEDAD SERÁ INFORMADA A TRAVÉS DE LOS CANALES OFICIALES DE PROSPERIDAD SOCIAL.

LE INVITAMOS A MANTENER ACTUALIZADOS LOS DATOS DE SU HOGAR EN SU CENSO POBLACIONAL CON SU AUTORIDAD INDÍGENA, SISBÉN IV O ICBF, SEGÚN APLIQUE Y ESTAR PENDIENTE POR MEDIO DE NUESTROS CANALES DE ATENCIÓN OFICIALES, TELEFÓNICO, VIRTUAL, PÁGINA WEB Y REDES SOCIALES.&quot;

&quot;
BRINDAR INDICACIÓN AL CIUDADANO DE PILAR SOLIDARIO +INDICACIÓN AL CIUDADANO DE CM (PARA QUIENES CUMPLEN REQUISITOS PARA INGRESAR A ESTE PROGRAMA)

MIENTRAS ENTRA EN VIGENCIA EL NUEVO PROGRAMA, SE ESTÁ REALIZANDO UN PROCESO DE RECOLECCIÓN DE DATOS A TRAVÉS DEL SIGUIENTE FORMULARIO: HTTPS://RIT.PROSPERIDADSOCIAL.GOV.CO/?ID=433 
ESTE TIENE COMO PROPÓSITO QUE LA ENTIDAD PUEDA LOCALIZARLE EN EL FUTURO Y BRINDARLE INFORMACIÓN ADICIONAL SOBRE EL PROGRAMA PILAR SOLIDARIO. DILIGENCIARLO NO GARANTIZA SU INSCRIPCIÓN NI ACTIVACIÓN EN NINGÚN PROGRAMA DEL ADULTO MAYOR.

USTED PUEDE COMPLETARLO DIRECTAMENTE, O SI LO PREFIERE, CON SU AUTORIZACIÓN, PUEDO AYUDARLE A DILIGENCIARLO. ¿CUÁL DE ESTAS OPCIONES PREFIERE USTED?
&quot;

&quot;SU HOGAR ACTUALMENTE REPORTA EN ESTADO ACTIVO(A) EN LA LÍNEA DE INTERVENCIÓN VALORACIÓN DE CUIDADO
&quot;

POR EL MOMENTO, NO CONTAMOS CON FECHAS EXACTAS PARA LA PRÓXIMA ENTREGA. LE AGRADECEMOS ESTAR PENDIENTE A TRAVÉS DE NUESTROS CANALES DE ATENCIÓN OFICIALES: TELEFÓNICO, VIRTUALES, PÁGINA WEB Y REDES SOCIALES.
